import { GET_USERS} from "./action-types"


const initialState = {
    users : [],
    searched:'',
    userDetails: {}
}


const reducer = (state = initialState, action) =>{
    switch(action.type){
        case GET_USERS:
            return {
                ...state,
                users: action.payload
            }

        // case GET_USER_DETAILS:
        //     return{
        //         ...state,
        //         userDetails:action.payload
        //     }

        default:
            return {...state}
    
        }
}

export default reducer;
